    giorno4 += "							<p class=\"p1\"><b>La lezione 4 è semplicemente strabiliante! Ecco perché:<\/b><\/p><p class=\"p1\">Gregg inizia esaminando le leggi della fisica, chiarendo in grande dettaglio e spiegando come i campi magnetici si inseriscono in queste leggi e, cosa più importante, come noi ci inseriamo in questo sistema.<\/p><p class=\"p1\">Ciò che è particolarmente affascinante è il modo in cui tutta la nostra creatività è estratta da questo campo. Che si tratti di scrittura creativa, idee imprenditoriali, risoluzione di problemi, pittura, persino scrittura di canzoni; le idee sono lì per noi!<\/p><p class=\"p1\"><b>Il nostro compito è manifestare queste idee fuori dal campo, nelle nostre teste e poi nelle nostre realtà.<\/b><\/p><p class=\"p1\">Può sembrare difficile, ma non preoccuparti, Gregg è a disposizione per dirci come possiamo farlo.<\/p><p class=\"p1\">Come se ciò non bastasse, Gregg conclude condividendo le sue ampie intuizioni sull’inizio dell’umanità ed espone le verità sul nostro potente DNA…<\/p><p class=\"p1\"><b>Cosa scoprirai:<\/b><\/p>						<\/div>";
