    giorno4 += "							<p class=\"p1\">Gregg nota come le nostre eccezionali capacità di imitazione siano possibili solo grazie ai nostri <i>neuroni specchio<\/i>, dal nome appropriato, e come questi siano cruciali quando si tratta di coerenza cuore\/cervello e di attrarre ciò che desideriamo per noi stessi.<\/p><p class=\"p1\"><b>Rispolvera le tue doti musicali!<\/b><\/p><p class=\"p1\">Gregg ci presenta una giovane che è una maga della chitarra elettrica che ha imparato tutto imitando…<\/p><p class=\"p1\">Imparerai quindi la storia incoraggiante del viaggio del Sidda tibetano <b>Milarepa<\/b> e di Gregg fino alla grotta dove compì miracoli quasi mille anni fa.<\/p><p class=\"p1\">(Incredibilmente, ci sono ancora ricordi visivi di questi miracoli all’interno della grotta, che Gregg mostra in questa lezione!)<\/p><p class=\"p1\">Gregg completa la lezione 6 sottolineando il potere delle affermazioni dirette.<\/p><p class=\"p1\"><b>L’universo non agirà in base alle tue affermazioni (che si tratti di denaro, felicità o amore, ecc.) a meno che tu non <i>senta <\/i>già di averlo ottenuto.<\/b><\/p><p class=\"p1\">Vuoi sapere come puoi attirare tutto ciò che desideri e materializzare?<\/p><p class=\"p1\">Impegnati nella lezione 6!<\/p><p class=\"p1\"><b>Cosa scoprirai:<\/b><\/p>						<\/div>";
