    giorno4 += "							<p class=\"p1\">Non è fantastico?!<\/p><p class=\"p1\"><b>Riparando i telomeri all’estremità dei nostri cromosomi, possiamo rinvigorire intenzionalmente le nostre cellule, arrestando sostanzialmente il processo di invecchiamento.<\/b><\/p><p class=\"p1\">Gregg non solo approfondisce il processo molecolare dietro questo miracoloso ringiovanimento, ma anche le tecniche segrete di cui abbiamo bisogno per metterlo in atto e per sentirsi e apparire più giovani!<\/p><p class=\"p1\">In seguito, Gregg parla di come lo stress sia uno dei principali fattori che contribuiscono all’invecchiamento e di come possiamo utilizzare il metodo dell’armonia cuore\/cervello per eliminare lo stress!<\/p><p class=\"p1\">Infine, Gregg conclude il suo fino ad oggi più innovativo corso fornendoti una formula per aiutarti a vivere al meglio la tua vita… Da non perdere…<\/p><p class=\"p1\"><b>Cosa scoprirai:<\/b><\/p>						<\/div>";
