    giorno3 += "							<i aria-hidden=\"true\" class=\"fas fa-check-circle\"><\/i>						<\/span>";
    giorno3 += "										<span class=\"elementor-icon-list-text\">Come gli insegnanti sono tenuti a insegnare falsi presupposti di una scienza obsoleta a causa delle leggi moderne.<\/span>";
