    giorno3 += "							<i aria-hidden=\"true\" class=\"fas fa-check-circle\"><\/i>						<\/span>";
    giorno3 += "										<span class=\"elementor-icon-list-text\">L'odio che vediamo nel mondo oggi è dovuto al modo in cui ci insegnano a pensare.<\/span>";
    giorno3 += "									<\/li>";
