    giorno3 += "										<span class=\"elementor-icon-list-text\">Che l'HB è solo l'inizio. Semplicemente praticando l’HBH il tuo sistema immunitario è più forte, gli enzimi della longevità sono attivati, hai una maggiore resilienza e una maggiore variabilità della frequenza cardiaca.<\/span>";
