    giorno3 += "				<div class=\"elementor-element elementor-element-668a105a elementor-widget elementor-widget-text-editor\" data-id=\"668a105a\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    giorno3 += "				<div class=\"elementor-widget-container\">";
    giorno3 += "							<p class=\"p1\">La vita non è sempre gentile, vero?<\/p><p class=\"p1\">Ad esempio, molti di noi hanno vissuto qualche tipo di trauma infantile e molti di noi semplicemente non hanno gli strumenti per affrontarlo.<\/p><p class=\"p1\">Diamine, alcuni di noi hanno difficoltà a elaborare il trauma.<\/p><p class=\"p1\">Nella lezione finale del corso pionieristico di Gregg, capirai che anche se potremmo non essere in grado di cambiare il passato, possiamo considerare il nostro passato attraverso la coerenza cervello-cuore. Ciò trasformerà completamente il modo in cui vedi il dolore che hai dovuto sopportare durante il tuo percorso e ti aiuterà a superare e ad accettare i tuoi traumi personali.<\/p><p class=\"p1\"><b>Cosa scoprirai:<\/b><\/p>						<\/div>";
