    giorno3 += "							<i aria-hidden=\"true\" class=\"fas fa-check-circle\"><\/i>						<\/span>";
    giorno3 += "										<span class=\"elementor-icon-list-text\">Come la coerenza cuore\/cervello può aiutarti a risolvere finalmente il trauma. (Meditazione guidata cuore\/cervello inclusa).<\/span>";
