    giorno3 += "				<div class=\"elementor-widget-container\">";
    giorno3 += "			<h2 class=\"elementor-heading-title elementor-size-default\">Gregg Braden<\/h2>		<\/div>";
    giorno3 += "				<\/div>";
    giorno3 += "				<div class=\"elementor-element elementor-element-5c3d2f6 elementor-widget elementor-widget-text-editor\" data-id=\"5c3d2f6\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">";
    giorno3 += "				<div class=\"elementor-widget-container\">";
    giorno3 += "							<p class=\"p1\">Gregg Braden è stato per cinque volte nella lista dei best seller del New York Times, è uno scienziato e pioniere del paradigma emergente che unisce scienza, politica sociale e potenziale umano.<\/p><p>Dal 1979 al 1991 Gregg ha lavorato come problem solver durante i periodi di crisi per aziende della Fortune 500, tra cui Cisco Systems, dove è diventato il primo Technical Operations Manager nel 1991. Attualmente continua con l’attività di problem solving grazie alla sua opera che rivela intuizioni profonde sulla storia del nuovo essere umano e come le scoperte influenzano le politiche della vita quotidiana e del mondo emergente. Ad oggi la sua ricerca lo ha portato ad avere 15 crediti cinematografici e 12 libri pluripremiati pubblicati in oltre 40 lingue.<\/p><p class=\"p1\">Gregg ha ricevuto numerosi premi tra cui il <em>Walden Award for New Thought<\/em>, l’<em>Illuminate Award for Conscious Visionaries<\/em> ed è elencato nel Watkins Journal del Regno Unito tra le prime 100 “persone viventi spiritualmente più influenti al mondo” per il settimo anno consecutivo. È candidato al prestigioso <em>Templeton Award<\/em>, istituito per onorare “individui viventi eccezionali che hanno dedicato il loro talento ad espandere la nostra visione dello scopo umano e della realtà”.<\/p><p>Gregg è attivamente coinvolto in organizzazioni visionarie e gruppi di esperti tra cui l’<em>American Association for the Advancement of Science (AAAS)<\/em>, <em>The Evolutionary Leadership Organization<\/em>, <em>The Laszlo Institute of New Paradigm Research<\/em> e <em>The Arlington Institute<\/em>. Ha presentato le sue scoperte in oltre 30 paesi in sei continenti ed è stato invitato a tenere discorsi dalle Nazioni Unite, dalle aziende Fortune 500 e dalle forze armate statunitensi.<\/p>						<\/div>";
    giorno3 += "				<\/div>";
    giorno3 += "				<\/div>";
