    giorno3 += "					<div id=\"elementor-tab-content-2605\" class=\"elementor-tab-content elementor-clearfix\" data-tab=\"5\" role=\"region\" aria-labelledby=\"elementor-tab-title-2605\"><p>Il Corso è disponibile in due versioni:<br>&gt; con la traduzione simultanea in italiano<br>&gt; in lingua originale inglese<\/p><p>Puoi seguire i video in inglese solo con audio inglese oppure attivare la funzione sottotitoli in inglese dall’apposito pulsante in basso a destra.<\/p><p><img decoding=\"async\" loading=\"lazy\" class=\"size-medium alignleft\" src=\"https:\/\/www.mylife.it\/genimg\/widget\/3617\" width=\"310\" height=\"118\"><\/p><\/div>";
